#include "common.h"
using namespace std;

namespace largestRectangleArea {

class Solution {
public:
    /**
     Find the lowest bar, which divides the bars
     into two groups, ones on its left, and its right.
     both left and right must have a rectangle whose
     height is > the height of the lowest bar.
     
     So to get the largest rectangle area, compare the
     largest rectangles for both left and right, and the
     one across all bars with height = height of the lowest
     bar.
     
     */
    int largestRectangleArea(vector<int>& heights) {
        if (heights.size()) {
            return dnc(heights, 0, heights.size() - 1);
        }
        return 0;
    }
private:
    int dnc(vector<int>& heights, int l, int r) {
        if (l > r) {
            return 0;
        }
        int res = 0;
        int minh = INT_MAX;
        int mini = -1;
        for (int i = l; i <= r; ++i) {
            if (heights[i] <= minh) {
                mini = i;
                minh = heights[i];
            }
        }
        
        if (mini > -1) {
            // expand leftward and rightward if either
            // side is of the same height as minh.
            int j = mini - 1;
            while (j >= l && heights[j] == minh) {
                --j;
            }
            int left = dnc(heights, l, j);
            
            j = mini + 1;
            while (j <= r && heights[j] == minh) {
                ++j;
            }
            int right = dnc(heights, j, r);
            int lowest = (r - l + 1) * minh;
            
            res = max(lowest, max(left, right));
        }
        return res;
        
    }

private:
};

}

